// https://github.com/sephiroth74/ImageViewZoom
public class ImageViewAty extends BaseAty {
    private String TAG = this.getClass().getSimpleName();
    ImageViewTouch mImage;
    ImageView crossIv;
    //传递过来的图片地址
    String imgUrlString;
    SweetAlertDialog pDialog;


    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        if (Build.VERSION.SDK_INT >= Build.VERSION_CODES.M) {
            this.requestPermissions(new String[]{Manifest.permission.READ_EXTERNAL_STORAGE}, 1);
        }
    }

    @NonNull
    @Override
    protected int getView() {
        return R.layout.pic_browser;
    }

    @Override
    public void initView(Bundle parms) {
        requestWindowFeature(Window.FEATURE_NO_TITLE);
    }

    @Override
    public void doBusiness(Context mContext) {
        mImage = findViewById(R.id.image);
        crossIv = findViewById(R.id.crossIv);
//        StringBuffer sb = new StringBuffer();
//        sb.append("");
//        sb.append("");
//        sb.append("");
//        sb.append("");
//        sb.append("");
//        sb.append("");
//        sb.append("");
//        sb.append("");
//        imgUrlString = sb.toString();
        if(BaseApplication.getOnLongClickPhotoBase64()!=null && !BaseApplication.getOnLongClickPhotoBase64().equals("")){
            imgUrlString = BaseApplication.getOnLongClickPhotoBase64();
            BaseApplication.setOnLongClickPhotoBase64("");
            pDialog = new SweetAlertDialog(this, SweetAlertDialog.PROGRESS_TYPE);
            pDialog.getProgressHelper().setBarColor(Color.parseColor("#A5DC86"));
            pDialog.setTitleText("正在加载中...");
            pDialog.setCancelable(false);
            pDialog.show();
        }
//        if (getIntent() != null) {
//            if (getIntent().getStringExtra("imgurl") != null) {
//                    imgUrlString = getIntent().getStringExtra("imgurl");
//                    pDialog = new SweetAlertDialog(this, SweetAlertDialog.PROGRESS_TYPE);
//                    pDialog.getProgressHelper().setBarColor(Color.parseColor("#A5DC86"));
//                    pDialog.setTitleText("正在加载中...");
//                    pDialog.setCancelable(false);
//                    pDialog.show();
//            }
//        }
        if (imgUrlString.contains("http:")||imgUrlString.contains("https:")) {
            LogUtils.e(TAG + "imgUrlString", imgUrlString);
            Glide.with(this).load(imgUrlString).listener(new RequestListener<Drawable>() {
                @Override
                public boolean onLoadFailed(@Nullable GlideException e, Object model, Target<Drawable> target, boolean isFirstResource) {
                    pDialog.dismiss();
                    return false;
                }

                @Override
                public boolean onResourceReady(Drawable resource, Object model, Target<Drawable> target, DataSource dataSource, boolean isFirstResource) {
                    pDialog.dismiss();
                    return false;
                }
            }).into(mImage);
        } else {
            mImage.setDisplayType(ImageViewTouchBase.DisplayType.FIT_TO_SCREEN);
            imgUrlString = imgUrlString.substring(imgUrlString.indexOf(",") + 1);
            byte[] bytes = Base64.decode(imgUrlString, Base64.NO_WRAP);
            Bitmap bitmap= BitmapFactory.decodeByteArray(bytes, 0, bytes.length);
            if(bitmap==null){
                Date date = new Date();
                SimpleDateFormat dateFormat= new SimpleDateFormat("yyyyMMddhhmmss");
                String hp_path = ImageViewAty.this.getExternalFilesDir(Environment.DIRECTORY_DCIM).getPath() +
                        File.separator + dateFormat.format(date) +".jpg";
                imgUrlString = imgUrlString.substring(imgUrlString.indexOf(",") + 1);
                boolean isOk = base64ToFile(imgUrlString,hp_path);
                if(isOk){
                    Glide.with(this).load(hp_path).listener(new RequestListener<Drawable>() {
                        @Override
                        public boolean onLoadFailed(@Nullable GlideException e, Object model, Target<Drawable> target, boolean isFirstResource) {
                            if(pDialog!=null){
                                pDialog.dismiss();
                            }
                            return false;
                        }

                        @Override
                        public boolean onResourceReady(Drawable resource, Object model, Target<Drawable> target, DataSource dataSource, boolean isFirstResource) {
                            if(pDialog!=null){
                                pDialog.dismiss();
                            }
                            return false;
                        }
                    }).into(mImage);
                }
            }else{
                Glide.with(this).load(bitmap)
                        .listener(new RequestListener<Drawable>() {
                            @Override
                            public boolean onLoadFailed(@Nullable GlideException e, Object model, Target<Drawable> target, boolean isFirstResource) {
                                if(pDialog!=null){
                                    pDialog.dismiss();
                                }
                                return false;
                            }

                            @Override
                            public boolean onResourceReady(Drawable resource, Object model, Target<Drawable> target, DataSource dataSource, boolean isFirstResource) {
                                if(pDialog!=null){
                                    pDialog.dismiss();
                                }
                                return false;
                            }
                        }).into(mImage);
            }

        }
    }

    /**
     *base64编码字符集转化成图片文件。
     * @param base64Str
     * @param path 文件存储路径
     * @return 是否成功
     */
    public static boolean base64ToFile(String base64Str, String path){
        byte[] data = Base64.decode(base64Str, Base64.NO_WRAP);
        for (int i = 0; i < data.length; i++) {
            if(data[i] < 0){
                //调整异常数据
                data[i] += 256;
            }
        }
        OutputStream os = null;
        try {
            os = new FileOutputStream(path);
            os.write(data);
            os.flush();
            os.close();
            return true;
        } catch (FileNotFoundException e) {
            e.printStackTrace();
            return false;
        }catch (IOException e){
            e.printStackTrace();
            return false;
        }

    }

    @Override
    public void onContentChanged() {
        super.onContentChanged();
    }

    @Override
    public void onConfigurationChanged(Configuration newConfig) {
        super.onConfigurationChanged(newConfig);
    }

    public void close(View view) {
        finish();
    }
}
